Da lâret eo 4 foent evit un trec'h, 2 boent evit ur c'hrogad rampo ha boent ebet tennet evit koll c'hoazh.
Da skouer daou drec'h heuliet gant ur c'hrogad rampo a ray 6 poent: 2 + 2 + (2 x 1)""","""2 boent pa vezit trec&#39;h, 1 poent evit bezañ rampo ha ma kollit ne vo ket skarzhet poent ebet deoc&#39;h. <br />Ma c&#39;hounezit daou grogad da heul ho po hanter vuioc&#39;h a boentoù, arouezet gant un arlun stumm ur flammenn dezhañ.<br />Keit ha ma veoc&#39;h o c&#39;hounit ho po hanter vuioc&#39;h a boentoù, betek ma kollfec&#39;h pe betek ma vefec&#39;h rampo.<br />Da lâret eo 4 foent evit un trec&#39;h, 2 boent evit ur c&#39;hrogad rampo ha boent ebet tennet evit koll c&#39;hoazh.<br />Da skouer daou drec&#39;h heuliet gant ur c&#39;hrogad rampo a ray 6 poent: 2 + 2 + (2 x 1)"""))
