m.put("arena:howDoesPairingWork",new Simple("""Penaos e ra ar mekanik evit kavout un enebour din?"""))
m.put("arena:howDoesPairingWorkAnswer",new Escaped("""E penn kentañ an tournamant e vez lakaet ar c'hoarierien damheñvel o renkadur da c'hoari an eil re a-enep ar re all. Ur wech echu ar c'hrogad kentañ e tistroer d'ar sal c'hortoz: c'hoari a reoc'h a-enep unan renket eveldoc'h en tournamant. Mod-se ne c'hortozoc'h ket kalz daoust ma n'ho po ket tro da c'hoari a-enep an holl.
